import React, { useEffect, useState } from 'react'
import { Slider, Switch, Row, Col } from 'antd'
import './index.css'

export default function SliderSelect() {
  const values = [
    {
      name: '颜色',
      children: [
        {name: 'red'},
        {name: 'blue'},
        {name: 'green'}
      ]
    },
    {
      name: '口味',
      children: [
        {name: '咸味'},
        {name: '甜味'},
        {name: '酸味'},
        {name: '辣味'}
      ]
    }
  ]
  return (
    <div>
      {values.map(item => {
        return (
          <div key={item.name} className='slider-group'>
            <div className='slider-group-title'>
              {item.name}
            </div>
            <div className='slider-group-content'>
              {item.children(childrenValue => {
                return (
                  <div key={`${item.name}${childrenValue.name}`}>
                    <Row>
                      <Col span={4}>
                        {childrenValue.name}
                      </Col>
                      <Col span={12}>
                        <Slider
                          min={1}
                          max={20}
                          // onChange={onChange}
                        />
                      </Col>
                    </Row>
                  </div>
                )
              })}
            </div>
          </div>
        )
      })}
    </div>
  )
}
